var app = {

    // Application Constructor
    initialize: function () {
        this.bindEvents();
        window.Testingimages = [];
    },
    // Bind Event Listeners
    //
    // Bind any events that are required on startup. Common events are:
    // 'load', 'deviceready', 'offline', and 'online'.

    bindEvents: function () {
        document.addEventListener('deviceready', this.onDeviceReady, false);
    },
    // deviceready Event Handler
    //
    // The scope of 'this' is the event. In order to call the 'receivedEvent'
    // function, we must explicitly call 'app.receivedEvent(...);'
    onDeviceReady: function () {
        app.receivedEvent('deviceready');

    },
    // Update DOM on a Received Event
    receivedEvent: function (id) {
        var parentElement = document.getElementById(id);
        var listeningElement = parentElement.querySelector('.listening');
        var receivedElement = parentElement.querySelector('.received');

        listeningElement.setAttribute('style', 'display:none;');
        receivedElement.setAttribute('style', 'display:block;');

        console.log('Received Event: ' + id);
    },

    takePicture: function () {

        openCamera();

        function setOptions(srcType) {
            var options = {
                // Some common settings are 20, 50, and 100
                quality: 100,
                destinationType: Camera.DestinationType.DATA_URL,
                // In this app, dynamically set the picture source, Camera or photo gallery
                sourceType: srcType,
                encodingType: Camera.EncodingType.JPEG,
                mediaType: Camera.MediaType.PICTURE,
                allowEdit: true,
                correctOrientation: true, //Corrects Android orientation quirks,
                targetHeight: 100,
                targetWidth: 100


            }
            return options;
        }

        function openCamera(selection) {

            var srcType = Camera.PictureSourceType.CAMERA;
            var options = setOptions(srcType);
            //var func = createNewFileEntry;
            var that = this;        

            navigator.camera.getPicture(function cameraSuccess(imageUri) {

                displayImage(imageUri);
                window.Testingimages = [];
                window.Testingimages.push(imageUri);
                    // You may choose to copy the picture, save it somewhere, or upload.
                    //func(imageUri);


            }, function cameraError(error) {
                console.debug("Unable to obtain picture: " + error, "app");

            }, options);
        }

        function displayImage(imgUri) {

            var elem = document.getElementById('imageFile');
            elem.src = "data:image/jpeg;base64, " + imgUri;
        }
    },

    analyzePicture: function () {
        console.log('hey')

        //var tf = new TensorFlow('inception-v1');


        var tf = new TensorFlow('custom-model', {
            'label': 'My Custom Model',
            'model_path': "https://files.fm/down.php?i=k4tm6wsy&n=custom-model.zip#retrained_graph.pb",//"http://www.filehosting.org/file/download/690268/hVj92SZrhZnvEQEr#retrained_graph.pb",
            'label_path': "https://files.fm/down.php?i=k4tm6wsy&n=custom-model.zip#retrained_labels.txt",//"http://www.filehosting.org/file/download/690268/hVj92SZrhZnvEQEr#retrained_labels.txt",
            'input_size': 299,
            'image_mean': 128,
            'image_std': 128,
            'input_name': 'Mul',
            'output_name': 'final_result'
        });

        var image23 =""

        var imgData;
        if (window.Testingimages.length == 0) {
            imgData = image23
        } else {
            imgData = window.Testingimages[0];
        }

        tf.load().then(() => {
            console.log('Model Loaded');
            tf.classify(imgData).then(results => {
                var elem = document.getElementById('result');
                results.forEach(result => {
                    console.log(result.title + "- " + result.confidence);
                    elem.innerHTML += result.title + "- " + result.confidence + "<br/>";
                });
            });
        });
            

        

    }
};
